import React, { useEffect, useRef, useState } from 'react';
import { ThreeScene } from '../utils/ThreeScene';
import './Scenarios.css';

function Scenarios() {
  const containerRef = useRef(null);
  const sceneRef = useRef(null);
  const [selectedScenario, setSelectedScenario] = useState(null);

  useEffect(() => {
    if (containerRef.current && !sceneRef.current) {
      sceneRef.current = new ThreeScene(containerRef.current);
      sceneRef.current.createParticles(120);
      sceneRef.current.createFloatingMesh();
    }

    return () => {
      if (sceneRef.current) {
        sceneRef.current.dispose();
        sceneRef.current = null;
      }
    };
  }, []);

  const scenarios = [
    {
      id: 'normal',
      name: 'Normal',
      icon: '‚òÄÔ∏è',
      description: 'Baseline conditions. Stable systems. Routine operations.'
    },
    {
      id: 'heatwave',
      name: 'Heatwave',
      icon: 'üî•',
      description: 'Extreme temperatures. Hospital load spikes. Cascading effects.'
    },
    {
      id: 'drought',
      name: 'Drought',
      icon: 'üèúÔ∏è',
      description: 'Water scarcity. Crop failure. Food security at risk.'
    },
    {
      id: 'crisis',
      name: 'Crisis',
      icon: '‚ö†Ô∏è',
      description: 'Multiple systems failing. Urgent intervention needed.'
    }
  ];

  return (
    <div className="scenarios">
      <div className="scenarios-hero">
        <div className="scenarios-canvas" ref={containerRef}></div>
        <div className="scenarios-hero-content">
          <h1>Scenario Simulation</h1>
          <p>Model futures. Understand interventions. Plan with confidence.</p>
        </div>
      </div>

      <section className="scenarios-section">
        <div className="scenarios-container">
          <div className="section-header">
            <h2>Explore Scenarios</h2>
            <p>Select a scenario to see how systems respond</p>
          </div>

          <div className="scenarios-grid">
            {scenarios.map((scenario) => (
              <div
                key={scenario.id}
                className={`scenario-card ${selectedScenario === scenario.id ? 'active' : ''}`}
                onClick={() => setSelectedScenario(scenario.id)}
              >
                <div className="scenario-icon">{scenario.icon}</div>
                <h3>{scenario.name}</h3>
                <p>{scenario.description}</p>
              </div>
            ))}
          </div>

          {selectedScenario && (
            <div className="scenario-detail">
              <div className="detail-content">
                <h3>Scenario Analysis</h3>
                <p>
                  This scenario reveals how interconnected systems respond to stress.
                  Environmental pressures cascade into health impacts, which affect food security
                  and economic stability. Understanding these connections enables proactive intervention.
                </p>
              </div>
            </div>
          )}
        </div>
      </section>

      <section className="simulation-section">
        <div className="simulation-container">
          <h2>How Simulations Work</h2>
          <div className="simulation-steps">
            <div className="step">
              <div className="step-number">01</div>
              <h4>Define Parameters</h4>
              <p>Set environmental, health, and food security variables.</p>
            </div>
            <div className="step">
              <div className="step-number">02</div>
              <h4>Model Interactions</h4>
              <p>The system calculates how changes cascade through interconnected systems.</p>
            </div>
            <div className="step">
              <div className="step-number">03</div>
              <h4>Evaluate Outcomes</h4>
              <p>See risk levels, economic impact, and recommended interventions.</p>
            </div>
            <div className="step">
              <div className="step-number">04</div>
              <h4>Plan Action</h4>
              <p>Use insights to design targeted, effective interventions.</p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Scenarios;
